import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Header from './components/Header';
import AdminHeader from './components/AdminHeader'; // Import the AdminHeader component
import Home from './pages/HomeScreen.js';
import Blog from './pages/BlogScreen.js';
import Services from './pages/ServicesScreen.js';
import Book from './pages/BookingScreen.js';
import FAQs from './pages/FAQs.js';
import Confirmation from './pages/ConfirmationScreen.js';
import Payment from './pages/PaymentScreen.js';
import BookingSummary from './pages/BookingSummary.js';

const App = () => {
  return (
    <Router>
      {/* User Header */}
      <Header />

      {/* Admin Routes */}
      <Routes>
        {/* Admin Header */}
        <Route path="/admin/*" element={<AdminHeader />} />

        {/* Admin Pages */}
        {/* <Route path="/admin/dashboard" element={<AdminDashboard />} />
        <Route path="/admin/bookings" element={<AdminBookings />} /> */}
        {/* Add more admin routes here */}

        {/* User Pages */}
        <Route path="/" element={<Home />} />
        <Route path="/blogs" element={<Blog />} />
        <Route path="/services" element={<Services />} />
        <Route path="/booking" element={<Book />} />
        <Route path="/faqs" element={<FAQs />} />
        <Route path="/confirmation" element={<Confirmation />} />
        <Route path="/payment" element={<Payment />} />
        <Route path="/booking-successful" element={<BookingSummary />} />
      </Routes>
    </Router>
  );
};

export default App;
